                })

                let arrOjbect = [];

                if (data.doctorData) {
                    data.doctorData.map(item => {
                        arrOjbect.push(item.doctorId)
                    })
                }
                if (arrOjbect) {
                    data.doctorData = arrOjbect;
                }
                data.clinicData = await db.Clinic.findOne({
                    where: { id: clinicId }
                })

                if (data) {
                    resolve({
                        errCode: 0,
                        errMessage: 'Get Clinic data completed!',
                        data: data
                    })
                }
            }




        }
        catch (e) {
            console.log(e);
            reject(e);
        }
    })
}

module.exports = {
    createClinic, getAllClinic, getDetailClinic
}
